import { useState, useEffect } from "react";
//import { handleLogin, handleLogout as logout } from "../scripts/auth";
import { Link } from 'react-router-dom';
import { UserProfile, logout, redirectToAuthCodeFlow, clientId} from "../scripts/authCodeWithPkce"

export const Navbar = () => {
  const [loggedIn, setLoggedIn] = useState(false);
  const [profile, setProfile] = useState<UserProfile | null>(null);

  useEffect(() => {
    const storedProfile = JSON.parse(localStorage.getItem("profile"));
    console.log(storedProfile)
    if (storedProfile) {
      setProfile(storedProfile);
      setLoggedIn(true);
    } else {
      setLoggedIn(false);
    }
  }, []); // Empty dependency array means this effect runs once on mount

   function handleLogout() {
    logout();
    setLoggedIn(false);
  };

  function handleLogin() {
    redirectToAuthCodeFlow(clientId);
  };

  return (
    <nav className="navbar navbar-expand-lg mx-5 pt-4 navbar-dark bg-dark">
      <div className="container-fluid">
        <Link className="navbar-brand" to="/">
          Spotify Analytics <i className="bi bi-bar-chart text-success"></i>
        </Link>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
            <Link className="nav-link" to="/artists">
                Top Artists
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/songs">
                Top Songs
              </Link>
            </li>
            <li className="nav-item dropdown">
              <a
                className="nav-link dropdown-toggle"
                href="#"
                id="navbarDropdown"
                role="button"
                data-bs-toggle="dropdown"
                aria-expanded="false"
              >
                Charts
              </a>
              <ul
                className="dropdown-menu dropdown-menu-dark"
                aria-labelledby="navbarDropdown"
              >
                <li>
                  <a className="dropdown-item" href="#">
                    Artists
                  </a>
                </li>
                <li>
                  <a className="dropdown-item" href="#">
                    Songs
                  </a>
                </li>
                <li>
                  <a className="dropdown-item" href="#">
                    Genres
                  </a>
                </li>
              </ul>
            </li>
          </ul>
          <div className="d-flex">
            {loggedIn ? (
              <div className="dropdown">
                <button
                  className="btn profileButton text-light fw-bold dropdown-toggle"
                  type="button"
                  data-bs-toggle="dropdown"
                  aria-expanded="false"
                >
                  <img
                    className="rounded-circle profilePic me-2"
                    src={profile?.images[0].url}
                    alt="profile picture"
                  />
                  {profile?.display_name}
                </button>
                <ul className="dropdown-menu dropdown-menu-dark">
                  <li>
                    <a className="dropdown-item" href="#">
                      Settings
                    </a>
                  </li>
                  <li>
                    <Link
                      className="dropdown-item"
                      to="/"
                      onClick={() => {
                        handleLogout()
                      }}
                    >
                      Logout
                    </Link>
                  </li>
                </ul>
              </div>
            ) : (
              <button className="btn btn-success" onClick={() => handleLogin()}>
                Sign in
              </button>
            )}
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
